import Layout from "../layout/Layout";
import NewAddModule from "../models/courseModulePage/NewAddModule";
import { Table } from "react-bootstrap";
import { getCourseData } from "../services/CopyCourseModule";
import { useEffect, useState } from "react";

const ModulePage = () => {
  useEffect(() => {
    getAllData();
  }, []);
  //console.log(user, "klmnop");
  const [user, setUser] = useState([]);

  const getAllData = async () => {
    const res = await getCourseData();
    console.log(res, "dddddddddddd");
    if (res && res.status === 200) {
      setUser(res.data.data);
    }
  };

  return (
    <>
      <Layout>
        <NewAddModule />
        <Table striped bordered hover size="sm">
          <thead>
            <tr>
              <th>State</th>
              <th>Course Title</th>
              <th>Module Title</th>
              <th>OrderNo</th>
              <th>Action</th>
            </tr>
          </thead>
          {user &&
            user.map((item) => (
              <tbody>
                <tr>
                  <td>{item.state}</td>

                  <td>{item.title}</td>
                  <td>{item.moduletitle}</td>
                  <td>{item.ordernumber}</td>
                </tr>
              </tbody>
            ))}
        </Table>
      </Layout>
    </>
  );
};
export default ModulePage;
